  false,\n\t\"url\": null,\n\t\"notes\": \"Biocontrol agents and chemicals to facilitate
  the rapid response phase of the project will be purchased and applied and a Washington
  Service Corps AmeriCorps member supported through FOTNWR will be hired. 500 acres
  of the refuge have been surveyed, 190 acres of infested refuge lands have been sprayed
  and over 400 Metzeneria paucipunctella were released in a large 5 acre infestation
  of spotted knapweed. Nearly 5 acres of roadsides and public use sites were treated
  by hand pulling and grubbing. All treatment areas were mapped with GPS.\",\n\t\"license_title\":
